import axios from "axios";

const useFetch = (url) => {
    const [data, setData] = useState(null);
    const headers = {
        "Accept":"application/json, text/plain, /",
        "Content-Type": "multipart/form-data",
    };

    useEffect(()=>{
        getData();
    }, [url]);

    const getData = async () =>{
        let response = await axios.get(url,{headers}).then((res)=>{return res.data});
        return response;
    }

    return [data];
}

export default useFetch;
